        //   projectId: "impresi-93d55",
        //   storageBucket: "impresi-93d55.appspot.com",
        //   messagingSenderId: "83130091195"
        // };

        firebase.initializeApp(config);
        async function getData() {
          const snapshot = await firebase.firestore().collection('screens').get()
          return snapshot.docs.map(doc => doc.data());
        }
        getData().then(function (data) {
          let transformedData = transformFirebaseData(data);

          return transformedData;
        });
      }

      transformFirebaseData(firebaseData) {
        let data = {};
        let screens = [];
        Object.keys(firebaseData.screens).forEach(function (key, index) {
          let firebaseScreen = firebaseData.screens[key];
          let screen = {};
          screen.id = key;
          let resources = [];
          Object.keys(firebaseScreen).forEach(function (key, index) {
            let group = firebaseScreen[key];
            Object.keys(group).forEach(function (key, index) {
              resources.push(screen[key]);
            });
            screen[key] = resources;
          });
          screens.push(screen);
        });
        data.screens = screens;
        return data;
      }

      addScreens(config) {
        if (config.firebaseConfig) {
          config.screens = this.getFirebaseScreens(config.firebaseConfig);
        }
        let self = this;
        if (!config.screens) {
          throw new Error('No screens exist in the data.');
        }
        config.screens.forEach(screen => {

          Object.keys(screen).forEach(function (key, index) {
            // key: the name of the object key
            // index: the ordinal position of the key within the object 
            let configActions = screen[key];
            let actions = [];
            if (key === 'in' || key === 'out') {
              configActions.forEach(resource => {

                if (!resource.type) {
                  throw new Error('All items must have a type.');
                }
                if (!resource.id) {
                  throw new Error('All items must have an id.');
                }
                if (!resource.options) {
                  resource.options = {};
                }
                resource.options.id = resource.id;

                switch (resource.type) {
                  case 'background':
                    let bg = self.createBackground(resource.options);
                    actions.push(new Action(bg));
                    break;
                  case 'heading':
                    let h = self.createHeading(resource.text, resource.options);
                    actions.push(new Action(h));
                    break;
                  case 'blurb':
                    let b = self.createBlurb(resource.text, resource.options);
                    actions.push(new Action(b));
                    break;
                  case 'image':
                    let i = self.createImage(resource.src, resource.options);
                    actions.push(new Action(i));
                    break;
                  default:
                    return;
                }
              });

              let group = new Group(key, actions);
              self.groups.push(group);
            }

          });

        });
      }

